import React from "react";

function Banner() {
  const breadcrumItems = [crypto, coins, bitcoin];
  return (
    <div className="banner_Container">
      <div className="breadcrumb">
        <ul>
          {breadcrumItems.map((item, i, row) => (
            <li className="breadcrumb_item">
              <a href="#">
                <span className={row.length === i + 1 && "breadcrumb_active"}>
                  {item}
                </span>
                {row.length !== i + 1 && (
                  <span className="breadcrumb_separator"> /</span>
                )}
              </a>
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
}

export default Banner;
